import { v4 as uuidv4 } from 'uuid'
import { Redirect } from 'react-router'

const id = null

function Home() {
  const [toggle, setToggle] = useState(true)
  return (
    <div>
      LOL
      {toggle ? null : <Redirect to={`/room/${id}`}></Redirect>}
      <button
        onSubmit={() => {
          setToggle(false)
          id = uuidv4()
        }}
      ></button>
      {/*
